import React from 'react';
import PropTypes from 'prop-types';

import { Container, Logo } from './styles';

export default function Header({ rec }) {
  return (
    <Container>
      {console.log(rec)}
      <Logo bg={rec ? '#f00' : '#eee'}>
        <h1>Live</h1>
        <div />
      </Logo>
      <button type="button">Sair</button>
    </Container>
  );
}

Header.propTypes = {
  rec: PropTypes.bool.isRequired,
};
